    const columnNames = ['Time', 'Fe57', ...columnStr.split(/\s+/).filter(el => !['Fe57', 'Time'].includes(el))]
    const rows = rowStr.trimStart().split('\n').map(
        (row, id) => {
            return { ...Object.fromEntries(row.trim().split(/\s+/).map((cell, idx) => [columnNames[idx], parseFloat(cell)])), id }
        }
    )
    const columns: GridColDef<(typeof rows)[number]>[] = columnNames.map(name => {
        return {
            field: name,
            width: name === 'Time' ? 30 : 70,
            renderCell: params => <span title={params.value}>{Math.round(params.value * 100)/100}</span>
        }
    })
    return <Form>
        <Modal.Header closeButton>
            <Modal.Title>View data file</Modal.Title>
        </Modal.Header>
        <Modal.Body>
            <Box sx={{ height: 800, width: '100%', marginTop: 2, marginBottom: 2 }}>
                <DataGrid sx={{ fontSize: '70%' }} rows={rows} columns={columns} disableRowSelectionOnClick />
            </Box>
        </Modal.Body>
        <Modal.Footer>
            <Button variant='secondary' onClick={() => data.setShowData(false)}>
              Close
            </Button>
        </Modal.Footer>
    </Form>
